import React, { Component } from 'react';
import './../CSS/Timeline.css'


class Timeline extends Component{

    constructor(props){
        super(props);
        this.state = {
            posts: [null, null, null],

        };

    }

    componentDidMount(){
        const newsArticle = fetch("https://newsapi.org/v2/top-headlines?country=us&apiKey=20154dc2da4d4cabbd1bcda1bc8bc69b")
        .then(response => {
            console.log(response);
            return response.json();
        }).then(result => {
            console.log(result.articles);
            this.setState({
                posts: result.articles,
            })
        })
        .catch(error => {
            console.log(error);
        })
    }


renderPost = () => {
    let post = [];
    for (let i=0; i< this.state.posts.length; i++){
        post.push(
            <div className="News">
                <h2>
                    this.state.posts.articles[i].title
                </h2>
                <div className="Article">
                    This is news.
                </div>
            </div>
        )
    }
    return post;
}


    render(){

        return(
            <>
            {this.renderPost()}
            </>
        )
    }

}

export default Timeline;
